import * as React from 'react';
import {  FlatList, Image, View, StyleSheet, Text, TouchableOpacity, ScrollView,} from 'react-native';
import { decks } from '../code/data';
import { ITEM_WIDTH } from '../code/carouselCardItem';
export default function PreviewScreen({navigation}){
  const handleDeckPress = (deck) => {
    setSelectedDeck(deck);
  };

  const renderQuestion = ({ item }) => ( //for question data
    <View style={styles.viewPadding}>
        <TouchableOpacity onPress={() => handleDeckPress(item)}style={styles.deckContainer}>
            <View style={styles.info}> 
                <Text style={styles.infotext}>{item.name}</Text>
                <View style={styles.info2}>
                    <Text style={styles.infotext2}>{item.items} items</Text>
                    <Text style={styles.infotext2}>{item.author}</Text>
                    <Text style={styles.infotext2}>{item.code}</Text>
                    <Text style={styles.infotext2}>{item.course}</Text>
                    <Text style={styles.infotext2}>{item.school}</Text>
                </View>
            </View>
        </TouchableOpacity>
    </View>
  );

  const renderAnswer = ({ item }) => ( //for answer data
    <View style={styles.viewPadding}>
        <TouchableOpacity onPress={() => handleDeckPress(item)}style={styles.deckContainer}>
            <View style={styles.info}> 
                <Text style={styles.infotext}>{item.name}</Text>
                <View style={styles.info2}>
                    <Text style={styles.infotext2}>{item.items} items</Text>
                    <Text style={styles.infotext2}>{item.author}</Text>
                    <Text style={styles.infotext2}>{item.code}</Text>
                    <Text style={styles.infotext2}>{item.course}</Text>
                    <Text style={styles.infotext2}>{item.school}</Text>
                </View>
            </View>
        </TouchableOpacity>
    </View>
  );

    return(
      <View style = {styles.scrollContainer}>
        <View>
          <Text style={styles.subtext}>Subject</Text> 
          <Text style={styles.titletext}>Title</Text>
          <Text style={styles.subtext2}>Flashcard</Text>
        </View>

        <View>
          <TouchableOpacity style={styles.buttonText}>Mark as Favorite</TouchableOpacity>
        </View>

        <View style={styles.alignedContainer}>
              <TouchableOpacity style={styles.button}>
              <Text style={styles.buttonText}>Add</Text>
              </TouchableOpacity>

              <TouchableOpacity style={styles.button}>
              <Text style={styles.buttonText}>Edit</Text>
              </TouchableOpacity>
        </View>
        
        <View style = {styles.flowContainer}>
           <FlatList 
           style={styles.flatlist} 
           showsVerticalScrollIndicator={false}
           data={decks}
            renderItem={renderQuestion} //note: idk if there's an existing deck of cards but just replace the contents with em on 
            />
            <FlatList 
           style={styles.flatlist} 
           showsVerticalScrollIndicator={false}
           data={decks}
            renderItem={renderAnswer} //note: idk if there's an existing deck of cards but just replace the contents with em on 
            />
        </View>
      </View>
          
    );
}

const styles = StyleSheet.create({ 

    scrollContainer:{
        flexGrow: 1,
        backgroundColor: 'rgba(0, 0, 0, 0)', 
        alignItems: 'center',
        justifyContent: 'center',
        backgroundColor: '#ECE3CE',
    },
    flatlist: {
        width: 300,
        paddingBottom: 150
      },
      button: {
        paddingVertical: 15,
        paddingHorizontal: 20,
        borderRadius: 5,
        margin: 10,
    },
    buttonText: {
      fontSize: 25,
      fontWeight: 'bold',
      color: '#526D84',
    },
    viewPadding: {
      padding: 10,
    }, 
    flatlist: {
      width: 300,
      paddingBottom: 150,
    },
    deckContainer: {
      width: ITEM_WIDTH,
      height: 170, // Set height equal to width
      marginHorizontal: 8, // Adjust margin as needed
      borderRadius: 8,
      backgroundColor: '#C9755E',
      shadowColor: '#000',
      shadowOffset: {
        width: 0,
        height: 2,
      },
      shadowOpacity: 0.25,
      shadowRadius: 3.84,
      elevation: 5,
    },
    info: {
      flex: 1,
      padding: 10,
      top: 5,
      position: 'absolute'
    },
    info2: {
      flex: 1,
      padding: 10,
      top: 70,
      left: 0,
      position: 'absolute'
    },
    infotext: {
      fontSize: 20,
      fontWeight: 'bold',
      color: '#4F6F52',
    },
    infotext2: {
      fontSize: 10,
      color: '#4F6F52',
    },
    subtext: {
      fontSize: 20,
      color: '#4F6F52',
    },
    subtext2: {
      fontSize: 25,
      color: '#4F6F52',
    },
    titletext: {
      fontSize: 40,
      fontWeight: 'bold',
      color: '#4F6F52',
    },
    flash: {
      width: 200,
      height: 170,
      position: 'absolute',
      flex: 1,
      left: 50, 
      alignContent: 'flex-end'
    },
    flowContainer:{
      flexDirection: 'row', 
      alignContent: 'center',
      paddingBottom: 10
    },
    alignedContainer:{
      flexDirection: 'row', 
      alignContent: 'flex-end',
      justifyContent: 'space-evenly',
      padding: 10
    },
})
